channel.observe('test.topic')
       .subscribe((res) => { // default Rx.Observable subscription
           // handle results
       });

const channel = rxmq.channel('test');
channel.requestTo({
    topic: 'test.topic',
    data: 'test data',
}).subscribe((response) => { // default Rx.Observable subscription
    // handle response
});

